__d(function(g,r,i,a,m,e,d){Object.defineProperty(e,"__esModule",{value:!0}),e.data=void 0;e.data=[{key:"A",subdivision:!0},{key:"Abcesso Peritoneal",content:"Cole\xe7\xe3o circunscrita de exsudato purulento frequentemente associada a edema e outros sinais de inflama\xe7\xe3o na regi\xe3o peritoneal."},{key:"Acidente Vascular encef\xe1lico (AVE)",content:"Qualquer evento cl\xednico agudo relacionado a comprometimento da circula\xe7\xe3o cerebral, de mais de 24 horas de dura\xe7\xe3o."},{key:"Acidente isqu\xeamico transit\xf3rio (AIT)",content:"Bloqueio tempor\xe1rio de aporte sangu\xedneo ao c\xe9rebro."},{key:"Acidente vascular cerebral (AVC)",content:"Qualquer evento cl\xednico agudo relacionado a comprometimento da circula\xe7\xe3o cerebral, de mais de 24 horas de dura\xe7\xe3o."},{key:"Acidose metab\xf3lica",content:"Concentra\xe7\xe3o de bicarbonato diminu\xeddo nos l\xedquidos corporais por causa do ac\xfamulo de \xe1cidos ou de perdas anormais de bases fixas do corpo, como na diarreia ou na doen\xe7a renal."},{key:"Adrenalina",content:" Uma catecolamina que \xe9 o principal neuro-horm\xf4nio da medula suprarrenal da maioria das esp\xe9cies; tamb\xe9m \xe9 secretada por neur\xf4nios. Seu uso resulta em aumento da frequ\xeancia card\xedaca e da forca de contra\xe7\xe3o, vasoconstri\xe7\xe3o ou vasodilata\xe7\xe3o, relaxamento do m\xfasculo liso bronquiolar e intestinal, glicogen\xf3lise, lip\xf3lise e outros efeitos metab\xf3licos."},{key:"Afasia",content:"Comprometimento ou aus\xeancia da compreens\xe3o, ou da produ\xe7\xe3o de, ou comunica\xe7\xe3o por, fala, escrita ou sinais, decorrente de uma les\xe3o adquirida do hemisf\xe9rio cerebral dominante."},{key:"Alcalose metab\xf3lica",content:"Alcalose associada a concentra\xe7\xe3o plasm\xe1tica arterial de bicarbonato, possivelmente em consequ\xeancia da ingest\xe3o excessiva de material alcalino ou da perda excessiva do \xe1cido na urina, ou por v\xf4mitos persistentes."},{key:"Alcalose respirat\xf3ria",content:"Desequil\xedbrio \xe1cido-b\xe1sico causado por respira\xe7\xe3o alveolar aumentada (hiperventila\xe7\xe3o), levando a uma concentra\xe7\xe3o diminu\xedda de di\xf3xido de carbono arterial plasm\xe1tico (PaCO2)."},{key:"Angina de Peito",content:"Dor intensa, frequentemente constritiva, geralmente referente a angina de peito, a. pec\u2019toris, a de peito; dor constritiva intensa no t\xf3rax, frequentemente irradiando-se do prec\xf3rdio para um ombro (geralmente o esquerdo) e para baixo pelo bra\xe7o, devido a isquemia do m\xfasculo card\xedaco, comumente causada por doen\xe7a coron\xe1ria."},{key:"Anticonvulsivante",content:"Que impede ou interrompe uma convuls\xe3o, um agente que exer\xe7a essa a\xe7\xe3o."},{key:"Antidepressivos tric\xedclicos",content:"Um grupo qu\xedmico de substancias antidepressivas que compartilham um n\xfacleo com 3 an\xe9is."},{key:"An\xf3xia",content:"Aus\xeancia completa ou quase completa de oxig\xeanio a partir dos gases inspirados, sangue arterial ou tecidos; a ser diferenciada da hip\xf3xia."},{key:"Ap\xeandice xifoide",content:"Em forma de espada, aplicado especialmente ao processo xifoide."},{key:"Arritmia card\xedaca",content:"Perda ou anormalidade do ritmo card\xedaco."},{key:"Asma",content:"Uma doen\xe7a inflamat\xf3ria dos pulm\xf5es caracterizada por obstru\xe7\xe3o revers\xedvel das vias a\xe9reas (na maioria dos casos). Originalmente um termo empregado para a \u2018\u2019dificuldade de respirar\u2019\u2019."},{key:"Ataxia",content:"Perda ou irregularidade da coordena\xe7\xe3o muscular."},{key:"Atelectasia",content:"Ar diminu\xeddo ou ausente em todo o pulm\xe3o ou em parte dele, com a resultante perda de volume pulmonar. A pr\xf3pria perda do volume pulmonar."},{key:"Atropina",content:"Uma mistura rac\xeamica de d- e l-hiosciamina, alcaloides obtidos das folhas e ra\xedzes da atropa belladonna; um anticolin\xe9rgico com efeitos diversos (taquicardia, midr\xedase, cicloplegia, constipa\xe7\xe3o, reten\xe7\xe3o urin\xe1ria, anti-sudoral) atribu\xeddos ao bloqueio competitivo revers\xedvel da acetilcolina nos receptores colin\xe9rgicos do tipo muscar\xednico; usada no tratamento por envenenamento por inseticidas organofosforados ou gases dos nervos."},{key:"Aura",content:"Fen\xf4menos ictais epil\xe9pticos percebidos apenas pelo paciente."},{key:"Ausculta",content:"Ouvir sons feitos pelas v\xe1rias estruturas corporais como m\xe9todo de diagn\xf3stico."},{key:"B",subdivision:!0},{key:"Basal",content:"Situado mais pr\xf3ximo a base de um \xf3rg\xe3o em formato de pir\xe2mide em rela\xe7\xe3o a um ponto de referencia espec\xedfico; oposto de apical. Indica um estado padr\xe3o ou de refer\xeancia de uma fun\xe7\xe3o, com uma base para compara\xe7\xe3o."},{key:"Base Pulmonar",content:"Superf\xedcie inferior do pulm\xe3o de formato c\xf4ncavo que repousa sob o diafragma."},{key:"Benzodiazep\xednico",content:"Uma classe de compostos com propriedades ansiol\xedticas, hipn\xf3ticas, anticonvulsivantes e relaxantes da musculatura esquel\xe9tica."},{key:"Bradicardia",content:"Diminui\xe7\xe3o na frequ\xeancia card\xedaca. Convenciona-se como normal no ser humano uma frequ\xeancia card\xedaca entre 50 e 100 batimentos por minuto. Frequ\xeancias abaixo de 50 constituem a\xa0bradicardia."},{key:"Broncoaspira\xe7\xe3o",content:"Aspira\xe7\xe3o de um corpo estranho para a arvore traqueobr\xf4nquica."},{key:"Broncodilatador inalat\xf3rio",content:"Conhecido popularmente como \u201cBombinha\u201d, o rem\xe9dio encontrado em alguns tipos de inaladores age reduzindo a inflama\xe7\xe3o e dilatando os br\xf4nquios, ajudando o ar a circular livremente. A asma pode ser causada pela polui\xe7\xe3o, por alergias e at\xe9 mesmo, fatores psicol\xf3gicos."},{key:"Broncofibroscopia",content:"Inspe\xe7\xe3o do interior da arvore traqueobr\xf4nquica por meio de um broncofibrosc\xf3pio."},{key:"C",subdivision:!0},{key:"Calafrio",content:"Sensa\xe7\xe3o de frios, com poss\xedveis tremores e palidez."},{key:"Carboidrato",content:"Designa\xe7\xe3o da classe dos derivados alde\xeddicos ou cet\xf4nicos de \xe1lcoois poli\xeddricos. Os carboidratos mais comuns cont\xe9m apenas carbono, hidrog\xeanio e oxig\xeanio, mas intermedi\xe1rios metab\xf3licos dos carboidratos nos tecidos tamb\xe9m cont\xe9m f\xf3sforo."},{key:"Cardiomiopatia",content:"Doen\xe7a do mioc\xe1rdio. Como classifica\xe7\xe3o da doen\xe7a, o termo \xe9 empregado com v\xe1rios sentidos diferentes, mas \xe9 limitado pela OMS a: \u2018\u2018processo m\xf3rbido prim\xe1rio do m\xfasculo card\xedaco na aus\xeancia de uma etiologia subjacente conhecida.\u2019\u2019 Quando se refere a miocardiopatia idiop\xe1tica."},{key:"Carpopedal",content:"Relativo ao punho e ao p\xe9, ou as m\xe3os e aos p\xe9s; designa principalmente o espasmo."},{key:"Catecolaminas",content:"Pirocatec\xf3is com uma cadeia lateral alquilamina; s\xe3o exemplos de interesse bioqu\xedmico: epinefrina e norepinefrina. Funcionam como elementos importantes em respostas ao estresse."},{key:"Cefal\xe9ia",content:"Dor em diversas partes da cabe\xe7a, n\xe3o limitada a \xe1rea de distribui\xe7\xe3o de qualquer nervo."},{key:"Cetoacidose diab\xe9tica",content:"\xc9 uma complica\xe7\xe3o metab\xf3lica aguda do\xa0diabetes\xa0caracterizada por hiperglicemia, hipercetonemia e\xa0acidose\xa0metab\xf3lica."},{key:"Cetona",content:"Subst\xe2ncia com grupamento carbonila ligando dois \xe1tomos de carbono."},{key:"Cet\xf4nico",content:"Relativo \xe0, ou que possui caracter\xedsticas de, uma cetona."},{key:"Cirrose",content:"Hepatopatia em est\xe1gio terminal caracterizada por le\xe3o difusa das c\xe9lulas parenquimatosas hep\xe1ticas, com regenera\xe7\xe3o nodular, fibrose e perturba\xe7\xe3o da arquitetura normal; associada a disfun\xe7\xe3o das c\xe9lulas hep\xe1ticas e interfer\xeancia com o fluxo sangu\xedneo no f\xedgado."},{key:"Coma",content:"Estado de inconsci\xeancia profunda no qual n\xe3o \xe9 poss\xedvel despertar."},{key:"Coma hiperosmolar hiperglic\xeamico n\xe3o cet\xf3tico",content:"\xc9 uma complica\xe7\xe3o metab\xf3lica do diabetes melito caracterizada por hiperglicemia grave, desidrata\xe7\xe3o extrema, hiperosmolaridade e altera\xe7\xe3o do n\xedvel de consci\xeancia."},{key:"Convuls\xe3o",content:"Espasmo violento ou s\xe9rie de contra\xe7\xf5es da face, tronco e membros."},{key:"Convuls\xe3o t\xf4nico-cl\xf4nico",content:"Crise caracterizada por uma sequ\xeancia que consiste numa fase t\xf4nico-cl\xf4nica; quando generalizada constitui o que conhecemos como crise de \u2018\u2018grande mal\u2019\u2019."},{key:"D",subdivision:!0},{key:"DEA (Desfibrilador Externo Autom\xe1tico)",content:"Equipamento que tem como fun\xe7\xe3o descarregar cargas el\xe9tricas na parede de um paciente que se encontra em quadro de arritmia card\xedaca. Seu objetivo \xe9 reverter este quadro em tempo h\xe1bil, de maneira que n\xe3o haja perda ou danos em fun\xe7\xf5es card\xedacas e cerebrais."},{key:"Dec\xfabito Lateral",content:"Posi\xe7\xe3o do paciente em rela\xe7\xe3o a superf\xedcie apoiada, apoiado sob a lateral do corpo, com o peitoral e face apontados em rela\xe7\xe3o lateral ao lado apoiado."},{key:"Dec\xfabito Ventral",content:"Posi\xe7\xe3o do paciente em rela\xe7\xe3o a superf\xedcie apoiada, apoiado sob peitoral, com as costas apontando ao lado oposto do apoiado, e rosto virado lateralmente."},{key:"Dec\xfabito dorsal",content:"Posi\xe7\xe3o do paciente em rela\xe7\xe3o a superf\xedcie apoiada, apoiado sob as costas, com o peitoral e face apontados ao lado oposto do apoiado."},{key:"Diabetes melito",content:"Um dist\xfarbio metab\xf3lico comum cr\xf4nico no qual h\xe1 comprometimento da utiliza\xe7\xe3o de carboidratos e aumento da utiliza\xe7\xe3o de lip\xeddios e prote\xednas; \xe9 causado por defici\xeancia absoluta ou relativa de insulina e caracterizado, em casos mais graves, por hiperglicemia cr\xf4nica, glicos\xfaria e perda de \xe1gua e eletr\xf3litos, cetoacidose e coma."},{key:"Diabetes tipo 1",content:"Menos comum, por a\xe7\xe3o autoimune, ocorre destrui\xe7\xe3o das c\xe9lulas beta, respons\xe1veis pela produ\xe7\xe3o de insulina."},{key:"Diabetes tipo 2",content:"Mais comum, por h\xe1bitos da vida, desencadeia resist\xeancia \xe0 insulina em tecidos perif\xe9ricos, bem como um defeito na secre\xe7\xe3o de insulina pelas c\xe9lulas beta."},{key:"Diaforese",content:"Suda\xe7\xe3o, transpira\xe7\xe3o intensa."},{key:"Diafragma",content:"A divis\xe3o musculomembranosa entre as cavidades abdominal e tor\xe1cica."},{key:"Dispneia",content:"Dificuldade ou angustia respirat\xf3ria subjetiva, geralmente associada a doen\xe7a dos cora\xe7\xf5es ou dos pulm\xf5es; ocorre normalmente durante esfor\xe7o f\xedsico intenso ou em grandes altitudes."},{key:"Dist\xfarbio End\xf3crino",content:"Os dist\xfarbios end\xf3crino-metab\xf3licos s\xe3o altera\xe7\xf5es dos horm\xf4nios do organismo que acarretam modifica\xe7\xf5es importantes nas taxas de glicemia, colesterol e triglicer\xeddeos."},{key:"Doen\xe7a card\xedaca isqu\xeamica",content:"Circula\xe7\xe3o inadequada para o mioc\xe1rdio, geralmente consequ\xeancia de coronariopatia."},{key:"Doen\xe7a de Addison",content:"Caracterizada pela produ\xe7\xe3o insuficiente de horm\xf4nios esteroides pelas gl\xe2ndulas adrenais."},{key:"Doen\xe7a renal cr\xf4nica",content:"les\xe3o renal e perda progressiva e irrevers\xedvel da fun\xe7\xe3o dos rins (glomerular, tubular e end\xf3crina)."},{key:"Dor precordial",content:"Dor associada a parte anterior da parte inferior do t\xf3rax e ao epig\xe1strio."},{key:"E",subdivision:!0},{key:"Epiglote",content:"Uma l\xe2mina de cartilagem el\xe1stica em forma de folha, coberta por mucosa, na raiz da l\xedngua, que serve como uma v\xe1lvula de desvio sobre a abertura superior da laringe durante o ato de degluti\xe7\xe3o; ela fica ereta quando est\xe3o sendo engolidos l\xedquidos, mas \xe9 passivamente curvada sobre a abertura quando s\xe3o engolidos alimentos s\xf3lidos."},{key:"Epinefrina",content:"Uma catecolamina que \xe9 o principal neuro-horm\xf4nio da medula suprarrenal da maioria das esp\xe9cies; tamb\xe9m \xe9 secretada por neur\xf4nios. Seu uso resulta em aumento da frequ\xeancia card\xedaca e da forca de contra\xe7\xe3o, vasoconstri\xe7\xe3o ou vasodilata\xe7\xe3o, relaxamento do m\xfasculo liso bronquiolar e intestinal, glicogen\xf3lise, lip\xf3lise e outros efeitos metab\xf3licos. (Usada no tratamento de asma br\xf4nquica)."},{key:"Esf\xedncter",content:"M\xfasculo que circunda um ducto, um tubo ou um orif\xedcio de modo que a sua concentra\xe7\xe3o diminui a luz ou orif\xedcio."},{key:"Espasmo",content:"Contra\xe7\xe3o involunt\xe1ria s\xfabita de um ou mais m\xfasculos; inclui c\xe2imbras e contraturas."},{key:"Estado asm\xe1tico",content:"Agravamento repentino, intenso e cont\xednuo do\xa0estado\xa0de asma, marcado por\xa0dispneia\xa0ao ponto de exaust\xe3o e colapso e que n\xe3o responde \xe0s medidas terap\xeauticas usuais."},{key:"Estado epil\xe9tico",content:"Crise epil\xe9ptica cont\xednua de longa dura\xe7\xe3o ou crises sequenciais sem recupera\xe7\xe3o da consci\xeancia entre elas."},{key:"Esteroides monoaminooxidase",content:"F\xe1rmacos\xa0inibidores da MAO, que tem por fun\xe7\xe3o inibi\xe7\xe3o da enzima\xa0monoamina oxidase\xa0(MAO), respons\xe1vel por degradar monoaminas como a noradrenalina, tiramina, dopamina e serotonina, aumentando assim a concentra\xe7\xe3o no corpo e no c\xe9rebro dessas subst\xe2ncias."},{key:"Est\xedmulo Sensorial",content:"Atrav\xe9s dos receptores, o indiv\xedduo capta\xa0est\xedmulos\xa0e informa\xe7\xf5es do ambiente que o cerca e do seu pr\xf3prio corpo. Os\xa0est\xedmulos\xa0s\xe3o transmitidos na forma de impulsos el\xe9tricos at\xe9 o sistema nervoso central."},{key:"F",subdivision:!0},{key:"Fadiga",content:"Estado que se segue a um per\xedodo de atividade mental ou f\xedsica, caracterizado por capacidade diminu\xedda para o trabalho e efici\xeancia reduzida de realiza\xe7\xe3o, geralmente acompanhado por sensa\xe7\xe3o de cansa\xe7o, sonol\xeancia ou irritabilidade."},{key:"Faringe",content:"A por\xe7\xe3o superior expandida do tubo digestivo, entre o es\xf4fago, abaixo, e a boca e cavidades nasais, acima e na frente; \xe9 distinta do restante do tubo digestivo porque \xe9 composta exclusivamente de musculo esquel\xe9tico (volunt\xe1rio) disposto e camadas circular externa e longitudinal interna."},{key:"Fibrila\xe7\xe3o ventricular",content:"Movimentos fibrilares r\xe1pidos, grosseiros ou delicados do m\xfasculo ventricular que substituem a contra\xe7\xe3o normal."},{key:"Fio retrator",content:"Fio o qual \xe9 utilizado para afastar a gengiva da coroa dent\xe1ria, normalmente utilizado em procedimentos de moldagem."},{key:"Frequ\xeancia card\xedaca",content:"N\xfamero de repeti\xe7\xf5es regulares em determinado espa\xe7o de tempo de batimentos card\xedacos."},{key:"Frequ\xeancia respirat\xf3ria",content:"O n\xfamero de respira\xe7\xf5es por minuto."},{key:"G",subdivision:!0},{key:"Glicemia capilar",content:"\xc9 um exame sangu\xedneo que oferece resultado imediato acerca da concentra\xe7\xe3o de glicose nos vasos capilares da polpa digital."},{key:"Glicocorticoster\xf3ides",content:"Qualquer composto semelhante a um esteroide capaz de influenciar de maneira significativa o metabolismo intermedi\xe1rio, promovendo a deposi\xe7\xe3o do glicog\xeanio hep\xe1tico e a produ\xe7\xe3o de um efeito anti-inflamat\xf3rio clinicamente \xfatil."},{key:"Glicose",content:"Um monossacar\xeddeo dextrorrotat\xf3rio encontrado, na forma livre, nas frutas e em outras partes das plantas, e na forma combinada em glicos\xeddeos, dissacar\xeddeos, oligossacar\xeddeos e polissacar\xeddeos; \xe9 o produto da hidr\xf3lise completa da celulose, do amido e do glicog\xeanio. A glicose livre tamb\xe9m est\xe1 presente no sangue, onde \xe9 a principal fonte de energia utilizada pelos tecidos do corpo."},{key:"Glicos\xedmetro",content:"Aparelho para aferir a glicose na corrente sangu\xednea."},{key:"Glucagon",content:"Um horm\xf4nio que consiste em polipept\xeddio de cadeia reta, com 29 res\xedduos aminoacil, extra\xeddo das c\xe9lulas alfa do p\xe2ncreas. A administra\xe7\xe3o parenteral de 0,5 a 1 mg de glucagon resulta em pronta mobiliza\xe7\xe3o do glicog\xeanio hep\xe1tico, elevando, assim, a concentra\xe7\xe3o da glicose no sangue."},{key:"Gl\xe2ndulas adrenais",content:"Gl\xe2ndula acess\xf3ria aos rins (tamb\xe9m chamadas de suprarrenais) produzem corticosteroides e catecolaminas."},{key:"Gradil Costal",content:"Conjunto formado pelas costelas (ossos alongados que se estendem da coluna vertebral at\xe9 o osso esterno)."},{key:"H",subdivision:!0},{key:"Hemiparesia",content:"Fraqueza que afeta um lado do corpo."},{key:"Hemoglobina glicada",content:"Hemoglobina glicada ou glicosilada (Hb A1C): a hemoglobina das hem\xe1cias, de forma lenta e irrevers\xedvel, absorve a glicose na mesma propor\xe7\xe3o em que se encontra na corrente sangu\xednea, formando a hemoglobina glicada. Esse exame, a partir da data de sua avalia\xe7\xe3o, d\xe1 a m\xe9dia das glicemias no per\xedodo dos \xfaltimos 60 a 90 dias (tempo de meia-vida das hem\xe1cias, fornecendo, portanto, informa\xe7\xf5es sobre o controle metab\xf3lico de longo prazo."},{key:"Hemoglobina glicosilada",content:"Hemoglobina glicada ou glicosilada (Hb A1C): a hemoglobina das hem\xe1cias, de forma lenta e irrevers\xedvel, absorve a glicose na mesma propor\xe7\xe3o em que se encontra na corrente sangu\xednea, formando a hemoglobina glicada. Esse exame, a partir da data de sua avalia\xe7\xe3o, d\xe1 a m\xe9dia das glicemias no per\xedodo dos \xfaltimos 60 a 90 dias (tempo de meia-vida das hem\xe1cias, fornecendo, portanto, informa\xe7\xf5es sobre o controle metab\xf3lico de longo prazo."},{key:"Hem\xe1cias",content:"Unidades morfol\xf3gicas da s\xe9rie vermelha do sangue, tamb\xe9m designadas por eritr\xf3citos ou gl\xf3bulos vermelhos."},{key:"Hidrocortisona",content:"Produto de redu\xe7\xe3o da cortisona; horm\xf4nio esteroide secretado pelo c\xf3rtex suprarrenal e o mais potente dos glicocorticoides de ocorr\xeancia natural nos seres humanos; agente anti-inflamat\xf3rio."},{key:"Hipercalcemia",content:"Concentra\xe7\xe3o anormalmente elevada de compostos contendo c\xe1lcio no sangue circulante; termo comumente utilizado para indicar uma concentra\xe7\xe3o elevada de \xedons c\xe1lcio no sangue."},{key:"Hipercapnia",content:"Aumento anormal da tens\xe3o arterial de di\xf3xido de carbono."},{key:"Hipercetonemia",content:"Concentra\xe7\xf5es elevadas de corpos cet\xf4nicos no sangue."},{key:"Hipercolesterolemia",content:"Presen\xe7a de n\xedveis anormalmente elevados de colesterol no sangue."},{key:"Hipersensibilidade tipo I",content:"Tamb\xe9m conhecida como \u2018\u2019Imediata\u2019\u2019, consiste na resposta imune exagerada mediada por anticorpos produzidos dentro de poucos minutos, ap\xf3s exposi\xe7\xe3o de um indiv\xedduo sensibilizado ao ant\xedgeno. As manifesta\xe7\xf5es clinicas consistem em alergia t\xf3pica e anafilaxia sist\xeamica."},{key:"Hipertens\xe3o",content:"Press\xe3o arterial elevada; eleva\xe7\xe3o transit\xf3ria ou persistente da press\xe3o arterial sist\xeamica para um n\xedvel pass\xedvel de induzir les\xe3o cardiovascular ou outras consequ\xeancias adversas. A hipertens\xe3o foi arbitrariamente definida por uma press\xe3o arterial (PA) sist\xf3lica acima de 140mmHg e PA diast\xf3lica superior a 90mm Hg."},{key:"Hipertermia",content:"Hiperpirexia induzida terapeuticamente. Maligna: in\xedcio r\xe1pido de febre extremamente elevada, com rigidez muscular, precipitada em indiv\xedduos geneticamente suscet\xedveis por agentes ex\xf3genos, especialmente por halotano ou succinilcolina."},{key:"Hipertireoidismo",content:"Anormalidade da gl\xe2ndula tireoide cuja secre\xe7\xe3o de horm\xf4nio tire\xf3ideo esta habitualmente aumentada e n\xe3o se encontra mais sobre o controle regulador dos centros hipotal\xe2mico-hipofis\xe1rios; caracteriza-se por um estado hipermetab\xf3lico, geralmente com perda de peso, tremores, n\xedveis plasm\xe1ticos elevados de tiroxina e\\ou triiodotironina e algumas vezes exoft\xe1lmia."},{key:"Hiperventila\xe7\xe3o",content:"Aumento da ventila\xe7\xe3o alveolar em rela\xe7\xe3o a produ\xe7\xe3o metab\xf3lica de di\xf3xido de carbono, de modo que a press\xe3o de di\xf3xido de carbono alveolar cai abaixo do normal."},{key:"Hipoglicemia",content:"Baixo n\xedvel de glicemia no sangue (faixa normal de glicose 60-100mgdL [3,3 a 5,6 mnol\\L]). Sintomas aut\xf4nomos consistem em sudorese, tremor, sensa\xe7\xe3o de calor, ansiedade e n\xe1useas. Sintomas neuroglicop\xeanicos incluem sensa\xe7\xe3o de tonteira, confus\xe3o, cansa\xe7o, dificuldade de falar, cefaleia e incapacidade de concentra\xe7\xe3o."},{key:"Hipoperfus\xe3o",content:"Hipo; Elemento de composi\xe7\xe3o de palavras que traz consigo a ideia de algo que ocupa uma posi\xe7\xe3o inferior ou escassez, falta, car\xeancia: hipotenso, quem tem tens\xe3o arterial inferior \xe0 normal.\nPerfus\xe3o; Introdu\xe7\xe3o lenta e cont\xednua de um medicamento ou de sangue num organismo ou \xf3rg\xe3o, com o aux\xedlio de uma inje\xe7\xe3o nos vasos sangu\xedneos: praticam-se perfus\xf5es intravenosas, subcut\xe2neas, retais."},{key:"Hipotermia",content:"Temperatura corporal significativamente abaixo de 37\xbaC."},{key:"Hipotireoidismo",content:"Produ\xe7\xe3o diminu\xedda de horm\xf4nio tire\xf3ideo; resulta em manifesta\xe7\xf5es clinicas de insufici\xeancia da tireoide, incluindo baixa taxa metab\xf3lica, tend\xeancia a ganhar peso, sonol\xeancia e, em algumas vezes, mixedema."},{key:"Hipovolemia",content:"Volume diminu\xeddo de sangue no corpo."},{key:"Hip\xf3xia",content:"Diminui\xe7\xe3o do oxig\xeanio abaixo dos n\xedveis normais nos gases inspirados, no sangue arterial ou no tecido, \xe0 exce\xe7\xe3o da an\xf3xia."},{key:"I",subdivision:!0},{key:"IN",content:"Intranasal."},{key:"Incontin\xeancia",content:"Incapacidade de impedir a expuls\xe3o de uma excre\xe7\xe3o, especialmente urina ou fezes."},{key:"Infarto do mioc\xe1rdio",content:"Infarto de uma \xe1rea do m\xfasculo card\xedaco, habitualmente em recorr\xeancia da oclus\xe3o de uma art\xe9ria coron\xe1ria."},{key:"Insufici\xeancia",content:"Incapacidade de completar a fun\xe7\xe3o ou poder. Card\xedaca - Pertencente ou relativo ao cora\xe7\xe3o: m\xfasculo card\xedaco.\nCongestiva - Ac\xfamulo anormal e excessivo de sangue nos vasos de um \xf3rg\xe3o, numa regi\xe3o do corpo ou numa estrutura corporal."},{key:"Insufici\xeancia adrenal",content:"Impossibilidade de completar a fun\xe7\xe3o, no caso das gl\xe2ndulas adrenais, inefic\xe1cia na produ\xe7\xe3o hormonal."},{key:"Insufici\xeancia card\xedaca",content:"Impossibilidade de completar a fun\xe7\xe3o card\xedaca."},{key:"Insufici\xeancia card\xedaca congestiva",content:"Insufici\xeancia-  Incapacidade de completar a fun\xe7\xe3o ou poder.\nCard\xedaca - Pertencente ou relativo ao cora\xe7\xe3o: m\xfasculo card\xedaco.\nCongestiva - Ac\xfamulo anormal e excessivo de sangue nos vasos de um \xf3rg\xe3o, numa regi\xe3o do corpo ou numa estrutura corporal."},{key:"Insulina",content:"Horm\xf4nio secretado pelas c\xe9lulas beta das ilhotas de Langerhans, que promovem a utiliza\xe7\xe3o da glicose, a s\xedntese de prote\xednas e a forma\xe7\xe3o e o armazenamento de lip\xeddeos neutros."},{key:"L",subdivision:!0},{key:"Letargia",content:"Comprometimento relativamente brando da consci\xeancia que resulta em redu\xe7\xe3o da vig\xedlia e da consci\xeancia; essa condi\xe7\xe3o apresenta muitas causas, mas, por fim, \xe9 provocada pela disfun\xe7\xe3o cerebral generalizada."},{key:"Lipotimia",content:"Perda moment\xe2nea e inesperada da consci\xeancia."},{key:"Loquacidade",content:"Facilidade ou aptid\xe3o para discursos."},{key:"L\xedvido",content:"De cor desmaiada; azulado."},{key:"M",subdivision:!0},{key:"Manobra de Heimlich",content:"A\xe7\xe3o designada para expelir um corpo estranho obstrutor da garganta colocando-se um punho sob o abdome entre o umbigo e a margem costal, segurando o punho por detr\xe1s, com a outra m\xe3o, e empurrando-o para dentro e para cima de forma a for\xe7ar a subida do diafragma, levando o ar da traqueia para cima e deslocando a obstru\xe7\xe3o."},{key:"Medula adrenal",content:"Parte do sistema nervoso aut\xf4nomo respons\xe1vel ela produ\xe7\xe3o de catecolaminas."},{key:"Mioc\xe1rdio",content:"A t\xfanica m\xe9dia do cora\xe7\xe3o, que consiste no m\xfasculo card\xedaco."},{key:"N",subdivision:!0},{key:"Nistagmo",content:"Oscila\xe7\xe3o r\xedtmica involunt\xe1ria dos globos oculares, seja pendular ou com componente lento ou r\xe1pido."},{key:"O",subdivision:!0},{key:"OVACE",content:"Obstru\xe7\xe3o de vias a\xe9reas causada por aspira\xe7\xe3o de corpo estranho."},{key:"Ortost\xe1tica",content:"Relativo a uma postura ou posi\xe7\xe3o de p\xe9."},{key:"Osteotomia",content:"Corte de um osso geralmente por uma serra ou oste\xf3tomo."},{key:"P",subdivision:!0},{key:"PaCO2",content:"\xc9 press\xe3o parcial de g\xe1s carb\xf4nico (com valores normais entre 35 a 45 mmHg)."},{key:"Palpita\xe7\xe3o",content:"Pulsa\xe7\xe3o vigorosa ou irregular do cora\xe7\xe3o, percebida pelo paciente, geralmente com aumento da frequ\xeancia ou for\xe7a, com ou sem irregularidade do ritmo."},{key:"Parada Cardiorrespirat\xf3ria",content:"Interrup\xe7\xe3o das atividades pulmonares e do cora\xe7\xe3o."},{key:"Parestesia",content:"Sensa\xe7\xe3o anormal, como de queima\xe7\xe3o, espetadelas, c\xf3cegas ou formigamento."},{key:"Pat\xeancia",content:"Desobstru\xe7\xe3o; desimpedimento; o estado de estar livremente aberto ou exposto."},{key:"Pat\xeancia das Vias A\xe9reas",content:"Permeabilidade ou abertura das vias a\xe9reas."},{key:"Perioral",content:"Ao redor da boca."},{key:"Peritoneal",content:"Perit\xf4nio \xe9 uma membrana porosa e semiperme\xe1vel, que reveste os principais \xf3rg\xe3os abdominais; o espa\xe7o entre esses \xf3rg\xe3os \xe9 a cavidade\xa0peritoneal."},{key:"Peritonite",content:"\xc9 uma inflama\xe7\xe3o do perit\xf4nio , membrana serosa que reveste parte da cavidade e das v\xedsceras abdominais. Pode ser localizada ou generalizada, e resulta, mais frequentemente de uma infec\xe7\xe3o ou, mais raramente, de um processo inflamat\xf3rio n\xe3o-infeccioso."},{key:"Pin\xe7a de Magill",content:"Pin\xe7a longa e curvada, com extremidade levemente arredondada."},{key:"Pneumonia",content:"Inflama\xe7\xe3o do par\xeanquima pulmonar caracterizada por consolida\xe7\xe3o da parte afetada, ficando os espa\xe7os a\xe9reos alveolares cheios de exsudato, c\xe9lulas inflamat\xf3rias e fibrina."},{key:"Posi\xe7\xe3o Supina",content:"De dec\xfabito dorsal, deitado sobre as costas."},{key:"Posi\xe7\xe3o de Trendelemburg",content:"Posi\xe7\xe3o de dec\xfabito dorsal sob a mesa de cirurgia, que \xe9 inclinada de v\xe1rios \xe2ngulos de forma que a pelve fica mais alta que a cabe\xe7a; usada durante ou ap\xf3s cirurgias na pelve ou no choque."},{key:"Posi\xe7\xe3o semi-flower",content:"Posi\xe7\xe3o inclinada obtida elevando-se a cabeceira do leito 25 a 37cm, fletindo os quadris e colocando um apoio sob os joelhos de forma que fiquem curvos a aproximadamente 90\xba, assim permitindo que o l\xedquido na cavidade abdominal acumule-se na pelve."},{key:"Posi\xe7\xe3o semi-supina",content:"Em dec\xfabito dorsal, com os joelhos flexionados e p\xe9s apoiados ao ch\xe3o, com a cabe\xe7a apoiada em uma superf\xedcie levemente maior que dist\xe2ncia do pesco\xe7o ao ch\xe3o."},{key:"Press\xe3o diast\xf3lica",content:"Press\xe3o intracard\xedaca durante o relaxamento diast\xf3lico ou resultante dele; a menor press\xe3o arterial atingida durante qualquer ciclo ventricular."},{key:"Press\xe3o sist\xf3lica",content:"Press\xe3o card\xedaca durante a contra\xe7\xe3o sist\xf3lica de uma c\xe2mara card\xedaca, ou resultante dela; a maior press\xe3o arterial alcan\xe7ada durante qualquer ciclo ventricular."},{key:"Pulso Braquial",content:"Dilata\xe7\xe3o r\xedtmica de uma art\xe9ria, no caso identificado pela posi\xe7\xe3o da m\xe3o sob o cotovelo do paciente apoiando os indicadores sob a parte ventral entre antebra\xe7o e bra\xe7o, diretamente sobre a art\xe9ria braquial."},{key:"Pulso Radial",content:"Dilata\xe7\xe3o r\xedtmica de uma art\xe9ria, observado na art\xe9ria radial com a posi\xe7\xe3o dos polegares sob a mesma."},{key:"Pulso carot\xeddeo",content:"Dilata\xe7\xe3o r\xedtmica das art\xe9rias car\xf3tidas no pesco\xe7o, produzida pelo volume de sangue lan\xe7ado no vaso pela contra\xe7\xe3o no cora\xe7\xe3o."},{key:"R",subdivision:!0},{key:"Respira\xe7\xe3o de Kussumaul",content:"\xc9 um padr\xe3o\xa0respirat\xf3rio\xa0profundo e trabalhoso associado com acidose metab\xf3lica grave, particularmente com a cetoacidose diab\xe9tica, mas tamb\xe9m com a insufici\xeancia renal."},{key:"S",subdivision:!0},{key:"Satura\xe7\xe3o",content:"Impregna\xe7\xe3o de uma subst\xe2ncia por outra na maior extens\xe3o poss\xedvel."},{key:"Sibilos",content:"Dist\xfarbios pulmonares como dificuldade de respirar, e ru\xeddos. Um som sibilante, rangido, musical ou soprado produzido durante a expira\xe7\xe3o pelo ar que atravessa as fauces, a glote ou vias a\xe9reas traqueobr\xf4nquicas estreitadas."},{key:"Sinais vitais",content:"Determina\xe7\xe3o da temperatura, frequ\xeancia respirat\xf3ria, pulso e press\xe3o arterial."},{key:"Subaracn\xf3idea",content:"Sob a membrana aracnoide."},{key:"Sudorese",content:"Excre\xe7\xe3o de l\xedquido pelas gl\xe2ndulas sudor\xedparas da pele."},{key:"S\xedncope",content:"A perda da consci\xeancia e do t\xf4nus postural causada pela redu\xe7\xe3o do fluxo sangu\xedneo cerebral."},{key:"T",subdivision:!0},{key:"Tapotagem",content:"Movimento de massagem que consiste em golpear com a parte lateral da m\xe3o, habitualmente com os dedos parcialmente flexionados."},{key:"Taquicardia",content:"Relativo a ou que sofre de a\xe7\xe3o card\xedaca excessivamente r\xe1pida."},{key:"Taquicardia ventricular",content:"Relativo a ou que sofre de a\xe7\xe3o card\xedaca excessivamente r\xe1pida; Parox\xedstica que se origina em um foco ect\xf3pico no ventr\xedculo."},{key:"Taquipneia",content:"Respira\xe7\xe3o r\xe1pida."},{key:"Tetania",content:"S\xedndrome neurol\xf3gica clinica caracterizada por contra\xe7\xf5es musculares, c\xe2imbras e espasmos carpopedais e, quando grave, laringoespasmo e convuls\xf5es; esses achados refletem a irritabilidade do sistema nervoso central e perif\xe9rico, habitualmente devido a baixos n\xedveis s\xe9ricos de c\xe1lcio ionizado ou menos comumente, magn\xe9sio."},{key:"Traqueia",content:"O tubo de ar que se estende da laringe at\xe9 o t\xf3rax."},{key:"U",subdivision:!0},{key:"\xdatero Grav\xeddico",content:"\xdatero - \xd3rg\xe3o muscular feminino oco no qual o ovulo fecundado se desenvolve.\nGrav\xeddico - Que acontece durante uma gravidez; pr\xf3prio do per\xedodo em que uma mulher est\xe1 gr\xe1vida."},{key:"V",subdivision:!0},{key:"Vasoconstritor",content:"Um agente que causa estreitamento dos vasos sangu\xedneos."},{key:"Ventila\xe7\xe3o",content:"Movimento de gases para dentro e fora dos pulm\xf5es."},{key:"Vias a\xe9reas",content:"Qualquer parte das vias respirat\xf3rias atrav\xe9s das quais passa o ar durante a respira\xe7\xe3o."}]},1493,[]);
